import React, { useState } from 'react'

const Test = () => {
    const [data,setData]=useState(0);

    const incrementVal=()=>{
        setData(()=>{
            data+1;
        })
    }

  return (
    <React.Fragment>
        {data}
        <button onClick={incrementVal}>click here</button>
    </React.Fragment>
  )
}

export default Test
